export default function Counter(){
  let count =0;
  const onClickPlus =()=>{
    count++;
  }
  return(
    <div className="counter">
      <div>
        <h2>Счётчик:</h2>
        <h1>{count}</h1>
        <button className="minus"></button>
      </div>
    </div>
  );
}
